import './App.css'
import Configuration1 from './components/Configuration/Configuration1'
import Configuration2 from './components/Configuration/Configuration2'
import Configuration3 from './components/Configuration/Configuration3'
import Test from './components/Test'
import React, { useState } from 'react'

function App() {
  const [userTaste1, setUserTaste1] = useState("") 
  const [userTaste2, setUserTaste2] = useState("") 
  const [userTaste3, setUserTaste3] = useState("") 

  const handleClick1 = (option) => {
    setUserTaste1(option)
  }
  const handleClick2 = (option) => {
    setUserTaste2(option)
  }
  const handleClick3 = (option) => {
    setUserTaste3(option)
  }

  return (
    <>
      <Configuration1 handleClick={handleClick1} />
      <Configuration2 handleClick={handleClick2} />
      <Configuration3 handleClick={handleClick3} />
      <Test result={userTaste1, userTaste2, userTaste3} />
    </>
  )
}

export default App
